senseDescription(pt):
O valor de uma unidade da moeda de câmbio em relação a outra unidade da moeda de câmbio;
Uma classificação que agrupa as taxas de câmbio;
A taxa na qual a moeda de um país ou região pode ser negociada contra a de outro país ou região;
O multiplicador utilizado para converter a moeda base do site na moeda compradora ou fornecedora.

Uma refeição que é comida no final da tarde ou noite diariamente.

Um lanche consistente em chá, bolinhos, geleia e creme que é comido no início ou meio da tarde.

Uma refeição leve do meio-dia de chá e sanduíches ou bolos;

O ato de passageiros e tripulantes embarcarem em um navio ou aeronave;
Embarcação é o ato de os passageiros entrarem em um veículo, geralmente no transporte público;
Embarkação é o processo de carregar uma embarcação de passageiros ou uma aeronave com passageiros ou militares, relacionado e sobrepondo-se ao embarque individual em aeronaves e navios.
